Verenigd Koninkrijk / Verenigde Staten
Actie / Avontuur
139 minuten

zeer goeie film

met James Franco, Martin Henderson en David Ellison

Deze film behandelt de avonturen van het LaFayette eskader, dat bestond uit jonge Amerikaanse vrijwilligers. Ze ontwikkelden 
zich tot de beste piloten van Frankrijk, en wonnen daarmee de steun van de stugge Fransen. Als Amerika ook in de Eerste 
Wereldoorlog wordt betrokken komen de nodige dilemma's om de hoek kijken.:
